css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.volkskrant.nl") {
body {
    background-image: none;
    background-color: #000;
    color: #AAA;
}

A[class^="artstyle"] {
    background-color: #000;
    color: #AAA;
}

A[class^="fjs"] {
    background-color: #FFF;
    color: #000;
}

span[class^="teaser"],
[class^="artstyle"] {
    background-color: #000;
    color: #AAA;
}

h1 {
    background-color: #000;
    color: #AAA;
}

div[class^=block] {
    background-color: #000;
    color: #AAA;
}

div[class^=teaser],
[class^=ad] {
    background-color: #000;
    color: #AAA;
}

article[class^=teaser] {
    background-color: #000;
    color: #AAA;
}

p {
    background-color: #000;
    color: #AAA;
}

}
